import React from 'react';
import Row from './Row';

export default function Grid({ guesses, wordLength }) {
  return (
    <div>
      {guesses.map((guessingGrid, i) => (
        <Row key={i} guess={guessingGrid} wordLength={wordLength} />
      ))}
    </div>
  );
}
